import ReactPropTypes from "prop-types"

const Header = ({title}) => {
    return(
        <header>
            <h1 style={{container}}>{title}</h1>
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.ReactPropTypes = {
    title: ReactPropTypes.string
}
export default Header
